import {
EDIT_POLIS
  } from "../Action/actionTypes";

  const initialState = {
    // token : "",
    data : []
  };

  export const getDataReducer = (state = initialState, action) => {
    const { type } = action;
    switch (type) {
      case EDIT_POLIS:
        return {
          ...state,
          loading: true,
          data : action.payload
        };

      default:
        return {
          ...state,
        };
        break;
    }
  };

  export default getDataReducer;
